import React from 'react'
import Login from './User/Login'
import Main from './UI/Main'

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      isLoggedIn: false,
    }
  }
  render() {
    if (this.isLoggedIn) {
      return (
        <Main />
      );
    }
    return (
      <Login isLoggedIn = {this.state.isLoggedIn}/>
    )
  }
}

export default App
